import { useState } from "react";
import "./Login.css";
const Login = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(`Email: ${email}, Password: ${password}`);
  };

  return (
    <form onSubmit={handleSubmit}>
      <label htmlFor="email">Email</label>
      <input
        type="email"
        name="email"
        id="email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
        required
      />
      <label htmlFor="password">Password</label>
      <input
        type="password"
        name="password"
        id="password"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
        required
      />
      <button type="submit">Sign in</button>
    </form>
  );
};

const SignUp = () => {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [userType, setUserType] = useState("");
  const [profilePicture, setProfilePicture] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(
      `Name: ${name}, Email: ${email}, Password: ${password}, Confirm Password: ${confirmPassword}, User Type: ${userType}, Profile Picture: ${profilePicture}`
    );
  };

  return (
    <form onSubmit={handleSubmit}>
      <label htmlFor="name">Name</label>
      <input
        type="text"
        name="name"
        id="name"
        value={name}
        onChange={(e) => setName(e.target.value)}
        required
      />
      <label htmlFor="email">Email</label>
      <input
        type="email"
        name="email"
        id="email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
        required
      />
      <label htmlFor="password">Password</label>
      <input
        type="password"
        name="password"
        id="password"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
        required
      />
      <label htmlFor="confirm-password">Confirm Password</label>
      <input
        type="password"
        name="confirm-password"
        id="confirm-password"
        value={confirmPassword}
        onChange={(e) => setConfirmPassword(e.target.value)}
        required
      />
      <label htmlFor="user-type">Register as:</label>
      <select
        name="user-type"
        id="user-type"
        value={userType}
        onChange={(e) => setUserType(e.target.value)}
        required
      >
        <option value="">Select user type</option>
        <option value="student">Student</option>
        <option value="teacher">Teacher</option>
      </select>
      <label htmlFor="profile-picture">Upload Profile Picture</label>
      <input
        type="file"
        name="profile-picture"
        id="profile-picture"
        accept="image/*"
        onChange={(e) => setProfilePicture(e.target.files[0].name)}
        required
      />
      <button type="submit">Register</button>
    </form>
  );
};

const RegistrationForm = () => {
  return (
    <div>
      <Login />
      <SignUp />
    </div>
  );
};

export default RegistrationForm;
